dates = [literal_eval(x) for x in dates]
dates = [(int(x),int(y)) for x,y in dates]
dates = sorted(dates)
dates = [str(x) for x in dates]

for key, val in data.items():
	fig, ax = plt.subplots()
	min_weight = 100
	for feature, weights in val.items():
		weights += [0] * (len(dates) - len(weights))
		min_weight = min(min_weight, min(weights))
		ax.plot(weights, label=feature, linewidth=1)
	ax.set_xlabel('Months (starting from 2000 Jan)')
	ax.set_ylabel('Weights')
	ax.axvline(x=dates.index(key), linewidth=1)
	ax.text(dates.index(key)+1, min_weight, key, rotation=90, va="bottom", size="smaller")
	fig.legend()
	fig.savefig(os.path.join(graph_output_folder, key+'.png'))
